import React, { Component } from "react";
import PostsContainer from "./gig-components/PostsContainer";

class Home extends Component {
  render() {
    return (
      <div>
        <center>
          <h2>First Page</h2>
          <p>Page Content.</p>
        </center>
        <PostsContainer />
      </div>
    );
  }
}

export default Home;
